import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import PrivateRoute from './components/PrivateRoute';

// Placeholder Pages (We will build these in upcoming modules)
const Home = () => <h1>Landing Page (Coming Soon)</h1>;
const Login = () => <h1>Login Page (Coming Soon)</h1>;
const Register = () => <h1>Register Page (Coming Soon)</h1>;
const AdminDashboard = () => <h1>Admin Dashboard (Protected)</h1>;
const UserDashboard = () => <h1>User Dashboard (Protected)</h1>;
const NotFound = () => <h1>404 Not Found</h1>;

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />

            {/* User Protected Routes */}
            <Route 
              path="/user/*" 
              element={
                <PrivateRoute roleRequired="user">
                  <UserDashboard />
                </PrivateRoute>
              } 
            />

            {/* Admin Protected Routes */}
            <Route 
              path="/admin/*" 
              element={
                <PrivateRoute roleRequired="admin">
                  <AdminDashboard />
                </PrivateRoute>
              } 
            />

            {/* Catch All */}
            <Route path="*" element={<NotFound />} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
